import React from 'react';
import "./App.css"

const Input = ({ type, label }) => {
  return (
    <div className="input-container">
      <input type={type} id={label} required />
      <label htmlFor={label}>{label}</label>
      <div className="bar" />
    </div>
  );
};

const Button = ({ text }) => {
  return (
    <div className="button-container">
      <button>
        <span>{text}</span>
      </button>
    </div>
  );
};

const PenTitle = () => {
  return (
    <div className="pen-title">
      <h1>Material Login Form</h1>
      <span>
        Pen <i className="fa fa-code" /> by{' '}
        <a href="http://andytran.me">Andy Tran</a>
      </span>
    </div>
  );
};

const Rerun = () => {
  return (
    <div className="rerun">
      <a href="">Rerun Pen</a>
    </div>
  );
};

const Login = () => {
  return (
    <div className="card">
      <h1 className="title">Login</h1>
      <form>
        <Input type="text" label="Username" />
        <Input type="password" label="Password" />
        <Button text="Go" />
        <div className="footer">
          <a href="#">Forgot your password?</a>
        </div>
      </form>
    </div>
  );
};

const Register = () => {
  return (
    <div className="card alt">
      <div className="toggle" />
      <h1 className="title">Register</h1>
      <div className="close" />
      <form>
        <Input type="text" label="Username" />
        <Input type="password" label="Password" />
        <Input type="password" label="Repeat Password" />
        <Button text="Next" />
      </form>
    </div>
  );
};

const Container = () => {
  return (
    <div className="container">
      <Login />
      <Register />
    </div>
  );
};

const Portfolio = () => {
  return (
    <a href="http://andytran.me/" id="portfolio" title="View my portfolio!">
      <i className="fa fa-link" />
    </a>
  );
};

const CodePen = () => {
  return (
    <a href="https://codepen.io/andytran/" id="codepen" title="Follow me!">
      <i className="fa fa-codepen" />
    </a>
  );
};

const App = () => {
  return (
    <div>
      <PenTitle />
      <Rerun />
      <Container />
      <Portfolio />
      <CodePen />
      </div>
)
}

export default App;
